import React from "react";
import './App.css'
import { AppBar, Toolbar, Typography, Button, IconButton } from '@material-ui/core'
import { MenuIcon } from '@material-ui/icons'

const title = {fontFamily: "'Akaya Telivigala', cursive", fontSize:"20px"};
const button1 = {marginLeft:"900px", fontSize:"15px"};
const button2 = {marginLeft:"50px", fontSize:"15px"};
const button3 = {marginLeft:"50px", fontSize:"15px"};

const Navbar2 = () => {


    return (
        <>
            <AppBar position="static" style={{backgroundColor: "white", color:"black"}}>
                <Toolbar>
                    <Typography variant="h5" style={title}  >
                        OkaySocial
                    </Typography>

                        <MenuIcon />

                        <Button style={button1}>Signin</Button>
                        <Button style={button2}>Signup</Button>
                        <Button style={button3}>Profile</Button>
                </Toolbar>
            </AppBar>

        </>
    );
};

export default Navbar2;
export {MenuIcon};
